import React from "react";
import {Link} from 'react-router-dom';
import './login.css';
class Login extends React.Component {
    constructor() {
        super();
        this.state = {
            username: '',
            email: '',
            password: ''
        };
        this.changeHandler = this.changeHandler.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    changeHandler(event) {
        this.setState({
            [event.target.name]: event.target.value
        });
    }

    async handleSubmit(event) {
        event.preventDefault();
        try {
            const response = await fetch('http://127.0.0.1:8000/login', {
                method: 'POST',
                body: JSON.stringify(this.state),
                headers: {
                    'Content-type': 'application/json; charset=UTF-8',
                }
            });

            if (response.ok) {
                console.log('User login successfully!');
                this.setState({
                    username: '',
                    email: '',
                    password: ''
                });
            } else {
                console.error('login failed.');
            }
            // Redirection vers la page racine
            this.props.history.push('/');
            // Rafraîchir la page après la redirection
            window.location.reload() 
        } catch (error) {
            console.error('An error occurred:', error);
        }
    }

    render() {
        return (
            
            <div>
                <section className="h-100 gradient-form" style="background-color: #eee;">
                <div className="container py-5 h-100">
                    <div className="row d-flex justify-content-center align-items-center h-100">
                    <div className="col-xl-10">
                        <div className="card rounded-3 text-black">
                        <div className="row g-0">
                            <div className="col-lg-6">
                            <div className="card-body p-md-5 mx-md-4">

                                <div className="text-center">
                                <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-login-form/lotus." style="width: 185px;" alt="logo"/>
                                <h4 className="mt-1 mb-5 pb-1">Solution Factory en Force</h4>
                                </div>

                                <form onSubmit={this.handleSubmit}>
                                <p>Veuillez vous identifier pour accéder à votre Espace RH:</p>

                                <div className="form-outline mb-4">
                                    <input type="text" id="username" className="form-control"
                                    placeholder="Enter votre username" />
                                    <label className="form-label" for="form2Example11">Username</label>
                                </div>

                                <div className="form-outline mb-4">
                                    <input type="password" id="form2Example22" className="form-control" />
                                    <label className="form-label" for="form2Example22">Mot de passe</label>
                                </div>

                                <div className="text-center pt-1 mb-5 pb-1">
                                    <button className="btn btn-primary btn-block fa-lg gradient-custom-2 mb-3" type="button">Log
                                    in</button>
                                </div>

                                <div className="d-flex align-items-center justify-content-center pb-4">
                                    <p className="mb-0 me-2">Don't have an account?</p>
                                    <button type="button" className="btn btn-outline-danger">Create new</button>
                                </div>

                                </form>

                            </div>
                            </div>
                            <div className="col-lg-6 d-flex align-items-center gradient-custom-2">
                            <div className="text-white px-3 py-4 p-md-5 mx-md-4">
                                <h4 className="mb-4">We are more than just a company</h4>
                                <p className="small mb-0">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod
                                tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud
                                exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>
                            </div>
                            </div>
                        </div>
                        </div>
                    </div>
                    </div>
                </div>
                </section>              
            </div>

        );
    }
}

export default Login;
